import React, { Component } from 'react';
import Link from 'next/link'

export default class Header extends Component {
    render() {
        const navLinks = [
            {
                text: "ùñïùñîùñóùñôùñãùñîùñëùñéùñî",
                link: "/"
            },
            {
                text: "ùñíùñéùñòùñà",
                link: "/misc"
            },
            {
                text: "ùñëùñéùñãùñä",
                link: "/blog"
            },
            {
                text: "ùñÜùñáùñîùñöùñô",
                link: "/about"
            },
            {
                text: "ùñàùñîùñìùñôùñÜùñàùñô",
                link: "/contact"
            }
        ]
        return <div>
            <nav className="navbar-light navbar-expand-lg bg-transparent">
                <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarTogglerDemo01" aria-controls="navbarTogglerDemo01" aria-expanded="false" aria-label="Toggle navigation">
                    <span className="navbar-toggler-icon"></span>
                </button>
                <h1 className="text-center font-weight-bold mt-5">ùñóùñäùñëùñëùñéùñîùñò</h1>
                <div className="collapse navbar-collapse" id="navbarTogglerDemo01">
                    <ul className="navbar-nav">
                        {navLinks.map(navItem => {
                            return <li key={navItem.text} className="nav-item">
                                <Link href={navItem.link}>
                                    <a className="nav-link">{navItem.text}</a>
                                </Link>
                            </li>
                        })}
                    </ul>
                </div>
            </nav>
        </div >
    }
}
